import * as t from './types'

export function buttonReducer(action) {
    switch (action.type) {
        case DID: {
          console.log('did')
        }
    
        case CANCELED: {
            console.log('canceled')
        }
    
        case CLOSED: {
            console.log('closed')
        }
    
        default:
          return;
      }

}
